    [],nt"num_tags": 3,nt"name": "montezuma-national-wildlife-refuge-quarterly-may-june-july-august-1942",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Montezuma National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1942.
    The report begins by summarizing the weather conditions and water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments and plantings.
    Resource management is outlined; topics include grazing, haying, and timber removal.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and violations. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
